import React from "react";
import styled from "styled-components";

const CurveSvg = styled.svg`
  position: absolute;
  top: 0;
  right: 0;
`;

const Menu = styled.svg`
  padding: 45px 60px;
`;

const Span = styled.span`
  font-style: var(--font-mono);
  color: #fff;
`;

const LandingPage = () => {
  return (
    <div>
      <Span>Hi</Span>
      <div>
        <img src={require("../image/Curve.svg")} alt="" />
      </div>
    </div>
  );
};

export default LandingPage;
